import React from 'react';
import './oldPrinterSeries.css';

const products = [
  { id: 1, name: "Product 1", price: "$10", image: "https://via.placeholder.com/300x200" },
  { id: 2, name: "Product 2", price: "$20", image: "https://via.placeholder.com/300x200" },
  { id: 3, name: "Product 3", price: "$30", image: "https://via.placeholder.com/300x200" },
  { id: 4, name: "Product 4", price: "$40", image: "https://via.placeholder.com/300x200" },
  { id: 5, name: "Product 5", price: "$50", image: "https://via.placeholder.com/300x200" },
  { id: 6, name: "Product 6", price: "$60", image: "https://via.placeholder.com/300x200" },
];

function OldPrinterSeries() {
  return (
    <div className="container">
      <h1>Our Products</h1>
      <div className="products">
        {products.map(product => (
          <div className="product" key={product.id}>
            <img src={product.image} alt={product.name} />
            <h3>{product.name}</h3>
            <p>Price: {product.price}</p>
            <button>Add to Cart</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Old
